import { useState } from "react";

export default function Login() {
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });

    const handleChange = (event) => {
        const [name, value] = event;
        setFormData(prevData => {
          return {...prevData, [name]: value};
        });
    };

    console.log(formData.name, formData.value);

    return (
      <div className="login-container">
        <h1>Sign in to your account</h1>
        <input type="text" name="email" id="email" value={ formData.email } placeholder="Enter your email" onChange={handleChange}/>
        <br />
        <br />
        <input type="password" name="password" id="password" value={ formData.password } placeholder="Enter password"
        onChange={handleChange}
        />
        <br />
        <br />
        <button>Login</button>
      </div>
    );
};
